import './App.css';
import axios from 'axios';
import { useState, useEffect } from "react";

function App() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:4000/ClientHome')
      .then(response => setUsers(response.data))
      .catch(err => console.error(err));
  }, []); // Boş dizi ikinci parametre olarak verilerek, yalnızca bir kez çağrılmasını sağlanır.

  return (
    <div className="App">
      <h1>Selam</h1>
      <div>
        {users.map(user => (
          <p key={user._id}>{user.name}</p>
        ))}
      </div>
    </div>
  );
}

export default App;
